{
	color: #FFFFFF
	!important;
}
::placeholder, .text-label, .see-all-link-icon, .footer-note, .text, .text-link, span.text, .blurb p, .checkbox-label, .reason, .text-muted, small, em, cite, .text-info, .place-name, a.text-nav:hover:not(.disabled) span
