{
	color: var(--text-dark);
}
.game-tile:hover:not(.disabled), .game-tile
{
	transition: transform .15s;
}

.games-page-lists-container, .games-list-container
{
	width: 100%
}
html
{
	background-color: var(--container) !important;
	background-image: url(https://cdn.discordapp.com/attachments/579828813970800652/579829800202534923/Arknights_-_Corridor.jpg) !important;
	background-attachment: fixed
	!important;
	
}
#header, .rbx-header, header, .header-wrap, nav.header
{
	background-color: var(--container-dark) !important;
	background-attachment: fixed !important;
}
